    false,nt"url": null,nt"notes": "This data set is a collection of three
    kinds of data. First data setnconsists of of files of Fish Histopathology data from
    the South TexasnOuter Continental Shelf (STOCS) study in the Gulf of Mexico from
    Julyn1976 to December 1977. The ship used was the R/V LONGHORN. These studiesnutilized
    vertebrate epifauna, demersal fishes and gonadal tissue ofnmacroepifauna and demersal
    tissues. The principal investigators werenJ.M. Neff and W.E. Haensley from Texas
    A&M, and S.A. Ramirez fromnUniversity of Texas. This work was funded by MMS contract
    numbern08550-CT5-16. The data is available in the F144 format of NODC fornMarine
    Toxic Substances. More information regarding this format can benobtained throgh
    the URL:nhttp://www.nodc.noaa.gov/General/NODC-Archive/f144.htmlnnThe second data
    set is the Hi resolution CTD data in the F022 format ofnNODC. More information on
    this format can be obtained from followingnURL: http://www.nodc.noaa.gov/General/NODC-Archive/f022.htmlnnThe
    third data set contains the files in F069 Marine Chemistry format of NODC. More
    information on this format can be obtained from followingnURL: http://www.nodc.noaa.gov/General/NODC-Archive/f069.html",nt"license_title":
